// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.7.0;

import "../utlis/Helper.sol";
import "../token/Fighter.sol";
import "../authority/Member.sol";

import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

/**
 * @title Fighter Z Token Card Shop
 *
 * It's mainly used for pledge to get M3T Token
 * QUANTITIES: 2 MILLION | DECIMALS: 18
 *
 * @author Bit Lighthouse. Ace
 * AT: 2021-3-28 | VERSION: v1.0.2
 */

contract CardShop is Member {
    using SafeMath for uint256;

    bool private _open = true;
    mapping (address => uint256) public _tokens;
    mapping(uint256 => uint256[]) public _heros;

    constructor(address auth_) Member(auth_) {

    }

    function _calculation(uint256[] memory _arrays)
        private view returns (uint256 result) {

        uint256 quantities = 0; uint256 total = 0;
        for (uint256 i = 0; i < _arrays.length; i++) {
            quantities = quantities.add(_arrays[i]);
        }

        uint256 _random = Helper.random(10000);
        for (uint256 i = 0; i < _arrays.length; i++) {
            if (_arrays[i] <= 0) continue;

            uint256 quality = _arrays[i];
            uint256 percent = quality.mul(10000);
            percent = percent.div(quantities);

            bool start = _random > total;
            bool end = _random <= total + percent;
            if (start && end) result = i;

            total = total + percent;
        }
    }

    function _fresh(uint256 quality_, uint256 heroId_, bool type_)
        private {

        if (type_) {
            _heros[100][quality_] = _heros[100][quality_].add(1);
            _heros[quality_][heroId_] = _heros[quality_][heroId_].add(1);
        } else {
            _heros[100][quality_] = _heros[100][quality_].sub(1);
            _heros[quality_][heroId_] = _heros[quality_][heroId_].sub(1);
        }
    }

    function freshExchange(uint256 quality_, uint256 heroId_)
        external CheckPermit("EXCHANGE") {

        _fresh(quality_, heroId_, true);
    }

    function buy(string memory name_) public {
        require(_open, "CARDSHOP: Shop is not open.");

        address token = authority.members(name_);

        bool success = IERC20(token).transfer(
            authority.members("RECIPIENT"), _tokens[token]
        );

        require(success, "CARDSHOP: Transaction failed");

        uint256 quality = _calculation(_heros[100]);
        uint256 heroId = _calculation(_heros[quality]);

        uint64 tokenId = Helper.generate(quality, heroId, _tokens[token]);
        Fighter(authority.members("FIGHTER")).doMint(msg.sender, tokenId);

        _fresh(quality, heroId, false);
    }
}

